import React from "react";

function SearchBar() {
  return (
    <div>
      <nav style={{ marginBottom: "30px" }} className="red accent-4">
        <div className="nav-wrapper">
          <a href="#" class="brand-logo" style="font-family: Antonio">
            Zaxximo
          </a>
        </div>
      </nav>
    </div>
  );
}

export default SearchBar;
